// @author       5035
// @match        http://1.1.1.3/ac_portal/default/pc.html
// @match        http://1.1.1.3/ac_portal/default/pc.html?pop=0&type=logout&username=5007
// @match        http://1.1.1.3/%E8%B6%85%E7%BA%A7%E8%B4%A6%E6%88%B7
